        "description": "[LYRICS BELOW] \"To Be A Man\" is a song I poured my heart into. I'm praying this reaches everyone who needs it. I believe in this one. Share this with everyone and anyone and let's make an IMPACT. Someone out there needs this. Love y'all...Thank you.\n\nClick here to listen:\nhttps://dax.lnk.to/wiiltbam\n\nFollow DAX: @ thatsdax \nShot by: Logan Meis\nProduced by: Lex Nour Beats\n\n#ToBeAMan #Dax #masculinity #manhood #manosphere #masculine #men #traditionalman \n\nLyrics:\n\nI can’t hide myself\nI don’t expect you to understand\nI just hope I can explain\nWhat it’s like to be a man\nIt’s a lonely road, and they don’t care about what you know\nIt’s not about how you feel but what you provide inside that home\n \nYeah\nI know this life can really beat you down\nYou wanna scream but you won’t make a sound\nGot so much weight that you've been holding but won’t show any emotion\nAs a man it goes unspoken\nThat we can’t cry when life gets hard\nUnconditional love’s for women, children, and dogs\nWe know that we just have to play our parts\nAnd don’t nobody give a d*mn about our broken hearts, yeah\n \nAs a man we gotta pave our way\nOur only function is to work and slave\nThere’s no respect for you if you ain’t payed\nYou’re disregarded as a human and you can’t complain\n And if you ever make it up and actually reach that place\nAnd find a woman that you love and give her your last name\nYou’ll feel the things that you provide is only why she stays\nAnd when you try to explain you’ll say…\n \nI can’t hide myself\nI don’t expect you to understand\nI just hope I can explain\nWhat it’s like to be a man\nIt’s a lonely road and they don’t care about what you know\nIt’s not bout how you feel but what you provide inside that home\n \nDon’t give up, keep fightin’\nAs a man our son(sun) is our horizon\nAnd our father’s actions play a role\nAnd we end up like ‘em\nSo they can’t let us see them hurt\n‘Cause we’ll embody what they do\nAnd start a generational curse\n No wonder most men are so depressed\nAll the things that they can’t express\nThey go to war \nget thrown on the shelf\nThen go back to war with their mental health\nThen grab that bottle and ask for help\nTry to pull themselves out of h*ll\nThen fall back down and then realize that they gon’ have to do it themselves\n \nIt’s the circle of life\nAs a man you provide\nThey don’t know what you’re worth ‘til the day that you die\nAnd that’s when they start cryin’\nThen move on to a man to confide in\n \nThat’s why we feel\nWe can’t hide ourselves\nWe don’t expect you to understand\nWe just hope we can explain\nWhat it’s like to be a man\nIt’s a lonely road and you don’t care about what we know\nIt’s not about how we feel but what we provide inside that home\n \nThat home\nIt’s not about how we feel but what we provide inside that home\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nIf you made it this deep you are a real one. TBH this is the most excited I've ever felt about a song.  Thank you all for continuing to allow me to use my platform to make an IMPACT! All the support is appreciated and not taken for granted. I'm excited to go to war with this one and watch it spread and create healthy conversation. I promise to continue to put my all into creating pieces of work we can all be proud of and carry throughout life. LIKE, COMMENT, SHARE and let's continue to spark minds and be the change we wish to see in the world. Much love!",
