          "description": "The official music video for \"1916\" by Sabaton. Taken from the music EP \"Stories From The Western Front\".\n➞ EXCLUSIVE MERCHANDISE: https://store.sabaton.net/product-tag/StoriesFromTheWesternFront/?utm_source=storelink&utm_medium=video&utm_campaign=youtube&utm_content=description\n➞ SUBSCRIBE for more Sabaton: https://sabat.one/YouTube\n\nPre-save Stories From The Western Front to hear it first: https://sabaton.bfan.link/stories-from-the-western-front\n\nSabaton discography: https://music.sabaton.net/discography\n\n► Spotify: This is Sabaton: https://open.spotify.com/playlist/37i9dQZF1DX99A2f2lNH9g?si=OX3cXWFET0yMYxt0Pnb5VQ \n► Apple Music: Sabaton Essentials: https://geo.music.apple.com/us/playlist/sabaton-essentials/pl.fc884049769d40c89d910887a34bbd15?itsct=music_box&itscg=30200&at=1010l35iz&ct=sabaton_essentials&app=music&ls=1\n\n======== Follow SABATON ==========\n\n• Facebook: https://sabat.one/Facebook\n• Twitter: https://sabat.one/Twitter\n• Instagram: https://sabat.one/Instagram\n• TikTok: https://sabat.one/TikTok\n• Spotify: https://sabat.one/Spotify\n• Apple Music: https://sabat.one/AppleMusicSabaton\n• Amazon Music: https://sabat.one/AmazonMusic\n• Deezer: https://sabat.one/Deezer\n• SoundCloud: https://sabat.one/SoundCloud\n• YouTube: https://www.youtube.com/c/Sabaton?sub_confirmation=1\n• Website: https://www.sabaton.net\n• Official Store: https://sabat.one/ytdshop\n\n• Facebook (Sabaton Store): https://sabat.one/FacebookStore\n• Instagram (Sabaton Store): https://sabat.one/InstagramStore\n\nSabaton History: https://www.youtube.com/c/SabatonHistory?sub_confirmation=1\n\n========= 1916 LYRICS ==========\n\nSixteen years old when I went to the war,\nTo fight for a land fit for heroes,\nGod on my side, and a gun in my hand,\nChasing my days down to zero,\nAnd I marched and I fought and I bled and I died,\nAnd I never did get any older,\nBut I knew at the time that a year in the line,\nWas a long enough life for a soldier,\n\nWe all volunteered, and we wrote down our names,\nAnd we added two years to our ages,\nEager for life and ahead of the game,\nReady for history's pages,\nAnd we brawled and we fought and we whored 'til we stood,\nTen thousand shoulder to shoulder,\nA thirst for the Hun, we were food for the gun,\nAnd that's what you are when you're soldiers,\n\nI heard my friend cry, and he sank to his knees,\nCoughing blood as he screamed for his mother,\nAnd I fell by his side, and that's how we died,\nClinging like kids to each other,\nAnd I lay in the mud and the guts and the blood,\nAnd I wept as his body grew colder,\nAnd I called for my mother and she never came,\nThough it wasn't my fault and I wasn't to blame,\nAnd the day’s not half over and ten thousand slain,\nAnd now there's nobody remembers our names\nAnd that's how it is for a soldier.\n\n========= Historic Fact ==========\n\nResulting in around 300,000 fatalities, the Battle of the Somme is considered one of the bloodiest and deadliest conflicts of the First World War and in human history. The battle, which was fought between British and French forces versus German forces, kicked off on July 1, 1916, and ended on November 18 that same year.\n\n==================================\nRecorded, mixed and mastered at Black Lounge studios by Jonas Kjellgren.\nMusic video was produced by Video Ink Ltd. https://www.videoink.co.uk\n==================================\nSabaton is a registered and protected trademark."
