        "fr": {
          "title": "L’atterrissage de ce Boeing 747 aurait pu mal finir",
          "description": "L’atterrissage de ce Boeing 747 de Cargolux aurait pu mal finir. Alors que l’avion cargo en provenance de Dubai s’apprête à atterrir samedi 15 avril 2023 en fin de journée sur l’aéroport de Luxembourg-Findel, tout ne se passe pas comme prévu. Juste après le toucher des roues, l’appareil rebondit, vire soudainement à gauche et son réacteur en bout d’aile frotte sur la piste. \n\nLes pilotes remettent aussitôt les gaz. L’avion de la compagnie aérienne luxembourgeoise Cargolux se posera finalement sans difficulté quinze minutes plus tard. Aucun blessé n’est à déplorer mais la nacelle, ce qui protège le réacteur, a été bien abimée.\n\nSi les « Touch and Go » ne sont pas rares, c’est à dire de toucher la piste et de redécoller, c’est le fait que l’appareil a été déséquilibré qui pose question. Une enquête a été ouverte. \n\nCréée en 1970, Cargolux qui est spécialisée dans le transport de fret aérien emploie 2 500 salariés. Basée à Luxembourg, elle opère uniquement des Boeing 747, elle en a 30 à ce jour."
