      "localizations": {
        "fr": {
          "title": "Japon : l’ombre de la guerre | ARTE Reportage",
          "description": "Le Japon vient d'opérer un virage historique. En décembre, Tokyo a annoncé un doublement de son budget défense d’ici 2027, du jamais-vu depuis la Seconde Guerre mondiale. \r\n\r\nA l’image de l'Allemagne, l’archipel est en pleine révision de sa doctrine militaire. Depuis la guerre en Ukraine et suite aux tensions renforcées dans le détroit de Taïwan, Tokyo muscle son dispositif militaire et se réarme face aux menaces multiples.\nDans les jungles de Nagasaki, notre équipe a pu suivre l’entraînement des commandos des Forces d'autodéfense, - l'équivalent de l'armée japonaise -, qui préparent leur pays à un éventuel conflit avec Pékin, la grande crainte de Tokyo. \nBien que le pays se montre officiellement attaché au pacifisme constitutionnel appliqué depuis 1947, la remilitarisation du Japon s’opère à grands pas.\nA cent-dix kilomètres de Taïwan, dans l’archipel d’Okinawa, sur l’île paisible de Yonaguni, réputée pour ses falaises altières et ses chevaux sauvages, les habitants craignent d'être entraînés dans un conflit entre les deux superpuissances mondiales, la Chine et les Etats-Unis...\nLes pêcheurs de Yonaguni dénoncent à la fois le harcèlement des garde-côtes chinois, mais aussi les missiles de Pékin, tombés dans les eaux japonaises en août 2022, lors d’exercices militaires chinois autour de Taïwan…\nSi le Japon, principal allié de Washington, est apprécié en Occident, il ne se révèle pas moins entouré de pays voisins hostiles, parmi lesquels trois puissances nucléaires : la Chine, la Corée du Nord, la Russie... C'est cet autre Japon, isolé, inquiet et encore traumatisé par les fantômes de la Seconde Guerre mondiale, que dépeint ce reportage.\r\n\r\nDisponible jusqu'au 03/04/2026\n#Japon #guerre #Arte\n\r\nAbonnez-vous à la chaîne ARTE https://www.youtube.com/channel/UCwI-JbGNsojunnHbFAc0M4Q/?sub_confirmation=1\n \nSuivez-nous sur les réseaux !\nFacebook : http://www.facebook.com/artetv\nTwitter : http://www.twitter.com/artefr\nInstagram : https://www.instagram.com/artefr"
        }
