          "title": "【4/18 岡田阪神×新井広島】甲子園で劇的サヨナラ勝利！最後は中野が侍ジャパン対決を制す！",
          "description": "【内容】\n2023年4月18日\n阪神 2x-1広島 （サヨナラ勝ち）\n\n甲子園に首位・広島を迎え撃った岡田阪神。\n阪神先発の西は強い雨が降る中、安定したピッチングを見せ、\n広島打線に得点を与えません。\n西を援護したい打線ですが広島先発九里の前にこちらも得点を奪えず。\n両チーム無得点のまま９回を迎えます。\n9回もマウンドに立った先発西はこの回先頭の菊地にヒットを許すと、\nその後ツーアウト3塁の場面で4番マクブルームに痛恨のタイムリーを浴び\n重い1点を許します。1点を追う阪神は9回裏1死から\n梅野・木浪が連続ヒットで繋ぎ1死3塁2塁。\n一打サヨナラのチャンスを作り甲子園も大盛り上がり。\n打席には代打渡邉。見逃し三振。\nその後2死満塁となり2番中野。マウンドには栗林。\n振りぬいた打球は左中間を破るサヨナラヒット！\n中野が侍ジャパン対決を制し、\n阪神が息詰まる攻防戦を劇的すぎるサヨナラ逆転勝利で飾りました。\n\n【テロップ訂正】9回裏の広島の得点が0点になっていました。正しくは「阪神 0-1 広島」です。訂正させていただきます。\n\n#トラトラタイガース #ARE  #劇的サヨナラ\n\n次回の読売テレビ（関西地区）の野球中継は\n４月２７日（木）　阪神対巨人　１９時から生中継💡\n是非ご覧ください🙇\u200d♂️\n\n20年以上続いた長寿番組「トラトラタイガース」がYouTubeで復活!\nぜひチャンネル登録をお願いします!\nhttps://bit.ly/3J35PY0\n\nTwitterも始めております‼\n是非フォローお願いします!\nhttps://mobile.twitter.com/1985toratora1\n\nytvの公式チャンネルとして阪神タイガースを応援していきます!\n皆さんの阪神愛を形にしませんか?\nコメント欄で見たい映像を募集中です!\n\n#阪神タイガース  \n#阪神 #トラトラタイガース\n\nあすリートチャンネルホームページ　https://ytv-athlete.jp/\nあすリートチャンネル YouTubeチャンネル　https://onl.la/DZ6eHLd"
        }
