          "description": "『ハラミちゃん 47都道府県ピアノツアー ～特急ハラミ号、出発進行だぬ！～』チケット一般発売スタート！！\n\nチケット購入はコチラ↓\n　●イープラス https://eplus.jp/harami/\n　●mu-mo TICKET http://r.y-tickets.jp/haramichan2301\n　●チケットぴあ https://w.pia.jp/t/harami/\n　●ローソンチケット https://l-tike.com/harami/\n　●CNプレイガイド　https://www.cnplayguide.com/harami/\n　●楽天チケット　http://r-t.jp/harami\n\n【特設サイト】\nhttps://harami47tour.com/\n\n＜第1弾発表！＞　\n2023年4月9日(日)  埼玉：大宮ソニックシティ 大ホール\n2023年4月22日(土) 石川：北國新聞赤羽ホール\n2023年4月23日(日) 福井：福井県県民ホール\n2023年5月3日(水祝)  大阪：大阪国際会議場 メインホール（グランキューブ大阪）\n2023年5月6日(土)  和歌山：和歌山城ホール 小ホール\n2023年5月7日(日)  徳島：阿南市文化会館 夢ホール\n2023年5月13日(土) 鳥取：とりぎん文化会館 小ホール\n2023年5月14日(日) 島根：島根県民会館 中ホール\n2023年5月20日(土) 岩手：岩手県民会館 中ホール\n2023年5月21日(日) 福島：けんしん郡山文化センター 中ホール\n2023年6月3日(土)  岡山：マービーふれあいセンター\n2023年6月4日(日)  香川：レクザムホール 小ホール\n2023年6月17日(土) 福岡：福岡国際会議場 メインホール\n2023年6月18日(日) 熊本：熊本城ホール シビックホール\n2023年7月15日(土) 滋賀：びわ湖ホール 中ホール\n2023年7月16日(日) 京都：ロームシアター京都　サウスホール\n2023年8月13日(日) 神奈川：神奈川県民ホール 大ホール\n\n14:00開場 15:00開演\n\n※熊本公演のみ 16:00開場 17:00開演 \n\n※開場・開演時間は変更になる場合がございます。\n\n■チケット：\n・一般ハラミ定食券  6,300円　\n\n・一般ハラミ定食券（こども学生割引）5,300円\n\n・特上ハラミ定食券　8,800円\n（メッセージ入りデザインLIVEチケット、季節で変わる！ハラミちゃんデザイン限定グッズ）\n\n・極上ハラミ定食券　29,000円\n（メッセージ入りデザインLIVEチケット、超希少部位！前方席確保！\n季節で変わる！ハラミちゃんデザイン限定グッズ、終演後ハラミちゃんとツ―ショット記念撮影！“MEET MEAT”へご招待！）\n\n■注意事項\n・3歳以上有料／3歳未満は膝上鑑賞無料（但し席が必要な場合は有料）\n・学割チケットは、公演日時点で3歳～18歳(高校生)が対象となります。\n　ご入場時に身分証明書の確認を行いますので、学生証や保険証等を必ずお持ちください。\n・限定グッズは会場でのお渡しのみとなります。\n・季節で変わる！ハラミちゃんデザイングッズは予告なく変更させていただきます。\n・政府自治体の新型コロナウイルスによりイベントの開催制限等の見解に基づき収容人数を決定いたします。今後のガイドラインの緩和により収容人数の変更が出る場合は、ご了承ください。\n\n🇫🇷spéciale thanks \n#sncfgare & connections \n\n✄-------------------‐✄\n\n💿CDアルバムの購入はこちら↓\nhttps://avex.lnk.to/HARAMI-2ID\n\n▼収録曲\n＊そばかす(JUDY AND MARY)\n＊異邦人(久保田 早紀)\n＊春よ、来い(松任谷 由実)\n＊プラネタリウム(大塚 愛)【限定トラックA】\n＊Story(AI)【限定トラックB】\n＊雨(ハラミちゃん)\n＊Rusty Nail(X JAPAN)\n＊947(ハラミちゃん)\n＊ひとり(ハラミちゃん)\n＊スパークル(RADWIMPS)\n＊夜に駆ける (YOASOBI)\n＊楓(スピッツ)\n＊BOHEMIAN RHAPSODY(QUEEN)\n＊銀河鉄道999(ゴダイゴ)\n\n🎹「ハラミちゃんピアノえほん」はこちら↓\nhttp://amzn.to/3JtTCLF\n童謡、夜に駆ける、ハラミ体操まで🎼🌙\nピアノのおもちゃ付きの絵本です！お子様のプレゼントにもピッタリ♪\n\n✄-------------------‐✄\n\n■お仕事依頼や連絡はコチラ📩\nhararapiano@gmail.com \n\n■ハラミがYoutubeをしている理由\nピアノ=\"子供の習い事\"や\"クラシカル\"なイメージがまだまだあると思います。\nもっとピアノという楽器が「楽しい」ということを知って欲しい！\nもっともっと身近にピアノを感じてもらいたい！\nそんな思いで動画を投稿しています♪\nよかったらチャンネル登録していただけると励みになります✨\n↓↓↓↓\nhttps://www.youtube.com/channel/UCr4fZBNv69P-09f98l7CshA?sub_confirmation=1 \n\n✄-------------------‐✄\n\n▼ファンクラブ🍖🎹\nいつでも入会お待ちしております♪いつ抜けていただいても構いません！\n・限定生配信ピアノコンサート\n・限定スタンプ＆限定バッチ(コメントで使えます)\n・限定Q&A生配信\n・限定オフショット＆限定ブログ などなど..\nhttps://www.youtube.com/channel/UCr4fZBNv69P-09f98l7CshA/join\n\n▼サブチャンネル🍖🎹\nゆるゆる日常、飯テロしてます🍚\nhttps://www.youtube.com/channel/UCDzNUObGnzyegwPYMDDJmjg?sub_confirmation=1\n\n▼Twitter🍖🎹\nhttps://bit.ly/3a8S09a\n\n▼instagram🍖🎹\nhttps://www.instagram.com/harami_piano\n\n▼TikTok🍖🎹\nhttps://vt.tiktok.com/ZSe3ggsYx/\n\n▼プロフィール🍖🎹\n・ポップスピアニスト【ハラミちゃん】と申します\n・2019年6月〜活動開始\n・お肉とポムポムプリンが大好きで絶対音感持ちです\n・2020年7月に1stCDアルバム「ハラミ定食〜Streetpiano Collection〜」を発売\n👑ビルボード週間総合ランキング1位\n👑オリコン週間総合ランキング2位\n👑オリコン週間J-POP部門1位\n・2020年8月中野サンプラザでワンマンLIVE開催\n・2020年8月a-nationに初のピアノ1台で出演\n・2020年12月全国ツアーを開催\n・2021年7月パシフィコ横浜でワンマンLIVE開催\n・2022年1月4日に武道館ワンマンLIVE開催\n・2022年9月11日に国際フォーラムホールAワンマンLIVE開催\n\n✄-------------------‐✄\n\nこんにちは、ハラミです🍖🎹\n\nフランスパリモンパルナス駅で『千本桜』を弾かせていただきました！\n\n是非最後までご覧ください！！\n良かったと思ったらチャンネル登録、高評価の方をよろしくお願い致します！🙌🍖🙏✨\n\n#ストリートピアノ #千本桜 #初音ミク\n\n千本桜/senbonzakura/初音ミク/hatsunemiku/ストリートピアノ/streetpiano/ピアノ/Piano/カバー/cover"
